import { useState } from 'react';

const Homepage = () => {

    const [blogs, setBlogs] = useState([
        {
            title: 'My new website',
            body: 'lorem ipsum....',
            author: 'mario'
        },
        {
            title: 'Welcome to my party!',
            body: 'lorem ipsum....',
            author: 'yoshi'
        },
        {
            title: 'Web dev top tips',
            body: 'lorem ipsum....',
            author: 'mario'
        }
    ]);

    return (
        <div className="home">

        </div>
    );
}

export default Homepage;
